import Layout from '../components/Layout';
import Gallery from '../components/gallery';

const images = [
    '../static/testi/tes1',
    '../static/testi/tes2',
    '../static/testi/tes3',
    '../static/testi/tes4',
    '../static/testi/tes5',
    '../static/testi/test6',
    '../static/testi/test7',
    '../static/testi/test8',
    '../static/testi/test9',
    '../static/testi/test10'
  ];

const testi = () => (
  <Layout title="testimoni">
        <div>
        <h2>Testimoni Customers</h2>
        <Gallery images={images} /> 
        </div>
  </Layout>
);

export default testi;
